function Music() {
  const { path } = useRouteMatch();
  return (
    <HashRouter>
      <div className="container">
      <h1>Music</h1>
      <nav className="menu">
          <ul>
            <li className="menu-item"><Link className="menu__link" to="/bio">Bio</Link></li>
            <li className="menu-item"><Link className="menu__link" to="/nosdois">Nos dois</Link></li>
            <li className="menu-item"><Link className="menu__link" to="/music/texts">Texts</Link></li>
          </ul>
      </nav>
      </div>
      <Switch>
        <Route path={`${path}/nosdois`}>

          <div><h1>nos dois</h1></div>
          </Route>
          <Route path="/music/texts" exact>

                    <div><h1>nos cara</h1></div>
        </Route>
        <Route path="/services" exact>
        </Route>
      </Switch>
    </HashRouter>
          );
        }

